    338 : [ 'pluralSight2020/Node.js - Getting Started.pdf', 'PluralSight', 'Node.js - Getting Started', 'Web and Mobile applications depend on back-end services to host their various resources and do most of the heavy lifting. Creating these back-end services is often very difficult, but the Node.js runtime makes it easier and more fun. In this course, Node.js: Getting Started, you\'ll learn the basic skills you need to create scalable back-end services with Node.js. First, you\'ll learn about the tools that come built-in with Node as well as some of the tools that are offered by the community. Next, you\'ll learn about package management, module dependencies, event-driven concurrency strategies, and how to write code to interface with the operating systems on servers. Finally, you\'ll discover the modern JavaScript features that you can use with Node.js today. When you\'re finished with this course, you\'ll be comfortable creating and executing code for Node.', 'pluralSight2020/Node.js - Getting Started.webp', ''], 
    339 : [ 'pluralSight2020/Node.js - The Big Picture.pdf', 'PluralSight', 'Node.js - The Big Picture', 'In this course, Node.js: The Big Picture, we begin with the places you\'ll commonly find Node being used, its technology origins, and a brief history of the project. We then examine what it means to write asynchronous code, and how Node both expects and embraces this approach with its own APIs and constructs. From there, we look at how to both modularize your own application code as well as leverage Node\'s vast 3rd party module ecosystem via npm. Finally, we wrap up with a discussion on assembling your own "tool belt" of Node.js tools and strategies to jump start your journey.', 'pluralSight2020/Node.js - The Big Picture.webp', ''], 
    340 : [ 'pluralSight2020/Node.js Testing Strategies.pdf', 'PluralSight', 'Node.js Testing Strategies', "Testing with Node.js and JavaScript can be intimidating. In this course, Rob Conery will offer tips and techniques he's used over the years for testing and maintaining large Node applications.", 'pluralSight2020/Node.js Testing Strategies.webp', ''], 
    341 : [ 'pluralSight2020/NPM Playbook.pdf', 'PluralSight', 'NPM Playbook', 'NPM is not just for Node developers - it has become the default package manager for front end JavaScript developers as well. This course will take you from knowing nothing about NPM to being an expert in using NPM to manage the dependencies for your project. Additionally, you will learn how to publish packages for other developers to use in their own projects, how to keep those packages updated, and how to coordinate them with your github repository.', 'pluralSight2020/NPM Playbook.webp', ''], 
